func TestDaGa_Run(t *testing.T) {

	movie, err := DaGa{}.Run("https://www.iqiyi.com/v_ckwrt5l8n8.html")
	if err != nil {
		t.Error(err.Error())
	}
	for _, chapter := range movie.Chapter {
		fmt.Println(chapter.M3u8Url)
	}
}

func TestYinghua_Run(t *testing.T) {

	movie, err := Yinghua{}.Run("http://www.dmh8.com/view/8480.html", 0)
	if err != nil {
		t.Error(err.Error())
	}
	for _, chapter := range movie.Chapter {
		fmt.Println(chapter.M3u8Url)
	}
}

func TestDouban_Run(t *testing.T) {
	movie, err := DouBan{}.Run("https://movie.douban.com/subject/35203351/", "爱奇艺视频")
	if err != nil {
		panic(err)
	}
	for _, chapter := range movie.Chapter {
		fmt.Printf("%s  %s\n", chapter.OrderStr, chapter.Url)
	}
}

